"Z vašim dovoljenjem bo OnePlus zbiral podatke o vaši uporabi telefona, da bi izboljšal zasnovo izdelka in uporabniško izkušnjo. Če se strinjate s pridružitvijo programu za izboljšavo izkušnje uporabe (»program«), to pomeni, da soglašate s tem, da OnePlus lahko zbira, uporablja in analizira naslednje informacije: 
 (1) konfiguracijski podatki;
 (2) statistični podatki aplikacije;
 (3) podatki vedenja uporabnikov;
 Z zbiranjem in analiziranjem zgoraj omenjenih podatkov OnePlus želi izboljšati uporabniško izkušnjo. Celoten postopek poteka v anonimizirani in šifrirani obliki za OnePlus, npr. preko izboljšanja učinkovitosti akumulatorja in stabilnosti sistema. Ti podatki ne bodo uporabljeni za osebno identifikacijo. Potem ko izberete sodelovanje v programu, lahko od tega programa kadar koli odstopite na naslednji način: Nastavitve – Napredno – Program za izboljšavo izkušnje uporabe, nato počistite izbiro potrditvenega polja. Za več informacij o obdelavi podatkov glejte Pravilnik o zasebnosti OnePlus. Ko odstopite od programa, bo OnePlus prenehal zbirati vaše zgoraj omenjene podatke."
